import styled from 'styled-components';
import theme from '../../styles/theme';

export const Container = styled.div`
  margin: 50px 0px;
  display: flex;
  width: 100%;
  align-items: center;
  span {
    white-space: nowrap;
    letter-spacing: 1px;
    margin: 0px 20px;
  }
  ::before, ::after {
    content: '';
    display: block;
    width: 100%;
    height: 2px;
    background-color: ${theme.colors.primary};
  }
`;
